}
*/
  }



  return (
    <Container fluid>
      <Jumbotron fluid id="bcgTemp">
      <Container fluid className="temp1">
        <h1 className="tempTitle">Starting points for your business.</h1>
        <p className="text1">
          Get started with any of our best-in-class website templates, whether it's contact forms or color
          palettes. Making a beautiful website has never been faster.
        </p>
      </Container>
      </Jumbotron>

      <Container fluid>
        <Row>
          <Col>
          
          
<div class="sidebar">
  <a class="active" href="#home">Home</a>
  <a href="#news">News</a>
  <a href="#contact">Contact</a>
  <a href="#about">About</a>
</div>


<div class="content">
  ..
</div>
          </Col>
        </Row>
      </Container>














    </Container>
  );
}

export default Templates;
